$(document).ready((function(){$("[data-bs-chart]").each((function(t,e){this.chart=new Chart($(e),$(e).data("bs-chart"))}))}));var tabStops=function(){for(var t=document.getElementsByClassName("tabs"),e=0;e<t.length;e++){var a=t[e].innerHTML;a=(a=(a=(a=a.replace(/[\t ]*(<br *\/?>|\r|\n)+/gi,"\n\t")).replace(/((\n\t)+$())|(^(\n\t)+([^\n]))/g,"$6")).replace(/(\n)/g,"</tr><tr>")).replace(/(\t+)([^\t]+)/g,"<td>$2</td>"),t[e].innerHTML='<table class="stops">'+a+"</table>"}};document.addEventListener("DOMContentLoaded",tabStops);